var Space = /** @class */function () {
  function Space(space) {
    this.isLocked = false;
    this.isOwner = false;
    this.isAdmin = false;
    this.numberOfPublications = 0;
    this.publications = [];
    this.id = space.id;
    this.title = space.title;
    if (space.is_locked) {
      this.isLocked = space.is_locked;
    }
    if (space.is_owner) {
      this.isOwner = space.is_owner;
    }
    if (space.is_admin) {
      this.isAdmin = space.is_admin;
    }
    if (space.number_of_publications) {
      this.numberOfPublications = space.number_of_publications;
    }
    if (space.publications) {
      this.publications = space.publications.map(function (publication) {
        return new Space(publication);
      });
    }
    // if (space.kanban) {
    //     this.kanban = space.kanban;
    // }
  }
  return Space;
}();
export { Space };
